import React from 'react';

function VideoSearchLine (props) {
    return (
      <div className="searcLineLayout">
        <form
          className="form"
          onClick={props.gettingVideoId}
        >
          <input
            className="string"
            type="text"
            name="searchQuery"
            autoComplete="off"
            value={props.searchQuery}
            onChange={props.textInputChange}
          />
          <button checked={props.indicatorButtonSearch} onClick={props.clickButton} className="button">Найти</button>
        </form>
      </div>
    )
}

export default VideoSearchLine
